###############################################################################
# Get the workflow data dir
###############################################################################
getDataDir() {
  echo "${alfred_workflow_data}"
}

getCacheDir() {
  echo "${alfred_workflow_cache}"
}

if [ ! -d "$(getDataDir)" ]; then
   mkdir -p "$(getDataDir)";
   touch "$(getDataDir)/mjolnir.txt";
fi

if [[ -d "$HOME/.hammerspoon" ]]; then
	cp alfred.lua $HOME/.hammerspoon/alfred.lua
	echo -n "Hammerspoon config upgrade installed. Please Reload.";
else
	echo -n "Please install Hammerspoon.";
fi

source ~/.bashrc
###############################################################################
# Get the workflow data dir
###############################################################################
getDataDir() {
  echo "${alfred_workflow_data}"
}

getCacheDir() {
  echo "${alfred_workflow_cache}"
}

if [ ! -d "$(getDataDir)" ]; then
   mkdir -p "$(getDataDir)";
   touch "$(getDataDir)/mjolnir.txt";
fi

echo -n "/usr/local/bin/hs" > "$(getDataDir)/mjolnir.txt";

if [[ -d "$HOME/.hammerspoon" ]]; then
	cp $HOME/.hammerspoon/init.lua $HOME/hs.org
	cp init.lua $HOME/.hammerspoon/init.lua
	cp alfred.lua $HOME/.hammerspoon/alfred.lua 
	echo -n "Hammerspoon config installed. Please Reload.";
else
	echo -n "Please install Hammerspoon.";
fi

###############################################################################
# Get the workflow data dir
###############################################################################
getDataDir() {
  echo "${alfred_workflow_data}"
}

getCacheDir() {
  echo "${alfred_workflow_cache}"
}

if [ ! -d "$(getDataDir)" ]; then
   mkdir -p "$(getDataDir)";
   touch "$(getDataDir)/mjolnir.txt";
fi

pf=`cat "$(getDataDir)/mjolnir.txt"`;

grid="{query}";

$pf -c "setgrid($grid)";
